import csvfrom django.core.management.base import BaseCommandfrom routes.models import ShipmentRouteclass Command(BaseCommand):    help = 'Import shipment routes from CSV file'    def handle(self, *args, **kwargs):        with open('/Users/hesamghanbari/Library/CloudStorage/OneDrive-Personal/Documents/MBA materials/Resume materials/Business Analytics/Portfolio projects/Supply chain optimization/Supply_Chain_Shipment_Pricing_Dataset_20240709.csv', 'r') as csvfile:            reader = csv.DictReader(csvfile)            headers = reader.fieldnames            print("CSV Headers:", headers)  # This will print the headers                        for row in reader:                print("Row:", row)  # Optional: Print each row for debugging                ShipmentRoute.objects.create(                    code=row['id'],                    origin=row['country'],  # Ensure this matches your CSV                    fulfillment_method=row['fulfill via'],                    shipment_mode=row['shipment mode'],                    molecule_or_test_type=row['molecule/test type'],                    brand=row['brand'],                    dosage=row['dosage'],                    dosage_form=row['dosage form'],                    unit_per_pack=float(row['unit of measure (per pack)']),                    line_item_quantity=float(row['line item quantity']),                    line_item_value=float(row['line item value']),                    pack_price=float(row['pack price']),                    unit_price=float(row['unit price']),                    manufacturing_site=row['manufacturing site'],                    first_line_designation=row['first line designation'],                    weight_kg=float(row['weight (kilograms)']),                    freight_cost_usd=float(row['freight cost (usd)']),                    line_item_insurance_usd=float(row['line item insurance (usd)']),                    scheduled_delivery_date=row['scheduled delivery date'],                    delivered_to_client_date=row['delivered to client date'],                    vendor=row['vendor']                )        self.stdout.write(self.style.SUCCESS('Data imported successfully'))